import { Mask } from "../hooks/useMask"

/**
 * 
 * @param value 
 */
function getRawValuesFromMaskedValue(value: string, mask: Mask): string {
    return value
        .replace(/[^\d]/g, '') // remove non numbers
}

/**
 * 
 * @param mask 
 */
function getMaskFromMaskedValue(mask: string): string {
    return mask
        .replace(/[^#]/g, '') // remove non mask characters
}

export {
    getRawValuesFromMaskedValue as getNumbersFromMaskedValue,
    getMaskFromMaskedValue,
}
